import React, { Component } from 'react';
import {withErrorBoundary} from "react-error-boundary";

class Data extends Component {
    state = {
        users: [],
        error: null
    };

    componentDidMount() {
        this.fetchData();
    }

    fetchData = async () => {
        try {
            const response = await fetch("http://localhost:8080/api/users");
            if (!response.ok) {
                throw new Error('Request failed');
            }
            const data = await response.json();
            this.setState({ users: data, error: null });
            console.log(data);
        } catch (error) {
            console.error(error);
            this.setState({ users: [], error: error.message });
        }
    };

    render() {
        const { users, error } = this.state;

        return (
            <div>
                <table>
                    <tr>
                        <th>Mail</th>
                        <th>Password</th>
                        <th>Name</th>
                        <th>Surname</th>
                        <th>Gender</th>
                        <th>Role</th>
                        <th>Reg. Customer</th>
                        <th>About</th>
                    </tr>
                    {error ? (
                        <tr>
                            <td colSpan="8">Error: {error}</td>
                        </tr>
                    ) : users.length === 0 ? (
                        <tr>
                            <td colSpan="8">Loading...</td>
                        </tr>
                    ) : (
                        users.map(user => (
                            <tr key={user.id}>
                                <td>{user.mail}</td>
                                <td>{user.password}</td>
                                <td>{user.name}</td>
                                <td>{user.surname}</td>
                                <td>{user.gender.gender}</td>
                                <td>{user.rolesList[0].role}</td>
                                <td>{user.regularCustomer.id}</td>
                                <td>{user.about}</td>
                            </tr>
                        ))
                    )}
                </table>
            </div>
        );
    }
}

export default withErrorBoundary(Data, {
    fallback: <h2>Something went wrong</h2>
});
